export enum Color
{
    Red,
    Blue,
    Green,
    Gray,
    White,
    Yellow,
    Black  
}

export function colorToString(color: Color): string {
    switch (color) {
        case Color.Red:
            return "Red";
        case Color.Blue:
            return "Blue";
        case Color.Green:
            return "Green";
        case Color.Gray:
            return "Gray";
        case Color.White:
            return "White";
        case Color.Yellow:
            return "Yellow";
        case Color.Black:
            return "Black";
        default:
            throw new Error("Invalid color");
    }
}
